import CountryStatistic from '../../src/components/CountryStatistic'


const Index = (props) => (
  <div >
    <CountryStatistic countryData={props.countryData} />
  </div>
)

Index.getInitialProps = async ({countryCode}) => {
  const resposne = await axios.get(`https://api.covid19api.com/total/country/${countryCode}`)

  return {
    countryData: response.data
  }
}

export default Index
